import React from 'react'

function BacktoTop() {
  return (
    <>
    <a href="#" className="btn btn-lg btn-secondary btn-lg-square back-to-top"><i className="bi bi-arrow-up"></i></a>
    </>
  )
}

export default BacktoTop
